import React, { Fragment } from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Header from './components/Header';
import Drawer from './components/drawer/Drawer';
import Home from './pages/Home';

const App = () => {
  return (
    <Fragment>
      <CssBaseline/>
      <Drawer>
        Alo
      </Drawer>
      <Header/>
      <main>
        <Home/>
      </main>
    </Fragment>
  );
}

export default App;
